# Create function to determine the age of building by its last remodel or construction year

def remodel_or_construction_age(rec):
    if(rec['YearBuilt'] == rec['YearRemodAdd']):
        return rec['YrSold'] - rec['YearBuilt']
    else:
        return rec['YrSold'] - rec['YearRemodAdd']

