# Define a function to drop columns that have more than a specific of threshold and similar values

def columns_high_same_value(percent):
    columns = []
    threshold = percent * len(data)
    for col in data:
        if(data[col].value_counts().max() >= threshold):
            columns.append(col)
    return columns
